import React, {useState} from "react";

function Table(props){
    const [isOpen, setIsOpen] = useState(false);

    const togglePopup = () => {
        setIsOpen(!isOpen);
    }
    let thub = props.thumbnail
    let source = "/imag/" + thub
    return (

        <tr id={props.id} >
            <td >{props.ID}</td> 
            <td><img src={source} alt=""/></td>
            <td >{props.FirstName }</td>
            <td >{props.LastName }</td>
            <td >{props.height}</td>

            <td>
                <button onClick={() => props.deleteMe(props.id)} >üóë</button>
            </td>
            <td>
                <button onClick={togglePopup} >üìù</button>
                {this.state.isOpen}
            </td>
        </tr>   
    )
}

export default Table;
